select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1579457055,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.16 Changelog",content="TSM v4.9.16 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with items not showing in Shopping search results in some situations<br />* [Retail] Fixed My Auctions total amounts<br />* [Retail] Fixed false-positive phasing messages<br />* [Retail] Fixed error after stopping a scan<br />* [Retail] Fixed issue with how Auctioning was rounding prices to the nearest silver<br />* [Retail] Fixed issue with trying to buy commodity items not always finding the auction<br />* [Retail] Fixed issue with purchased auctions not being counted towards mail inventory<br />* [Retail] Fixed issue with Shopping buy confirmation showing the incorrect auction price<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579231740,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-16-changelog/"},{title="TradeSkillMaster v4.9.15 Changelog",content="TSM v4.9.15 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Auctioning will now report a buyout above